function Model(props) {
    
    console.log(props.props.state);

    if(props.props._id){
        return(
            <div className="Model">
                <div class="card" style="width: 18rem;">
                    <ul class="list-group list-group-flush">
                        <li class="list-group-item">State:{props.props.state}</li>
                        <li class="list-group-item">Date:{props.props.date}</li>
                        <li class="list-group-item">A third item</li>
                    </ul>
                </div>
            </div>
        )
    }
   else{
    return(
        <div className="Model">
            <div class="card">
                <ul class="list-group list-group-flush">
                    <li class="list-group-item">State:{props.props.state}</li>
                </ul>
            </div>
        </div>
    )
   }
}
export default Model;
